     * - `account` must have at least `amount` tokens.
     */
    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _beforeTokenTransfer(account, address(0xdead), amount);

        _balances[account] = _balances[account].sub(amount, "ERC20: burn amount exceeds balance");
        _totalSupply = _totalSupply.sub(amount);
        emit Transfer(account, address(0xdead), amount);
    }

    /**
     * @dev Sets `amount` as the allowance of `spender` over the `owner` s tokens.
     *
     * This internal function is equivalent to `approve`, and can be used to
     * e.g. set automatic allowances for certain subsystems, etc.
     *
     * Emits an {Approval} event.
     *
     * Requirements:
     *
     * - `owner` cannot be the zero address.
     * - `spender` cannot be the zero address.
     */
    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    /**
     * @dev Hook that is called before any transfer of tokens. This includes
     * minting and burning.
     *
     * Calling conditions:
     *
     * - when `from` and `to` are both non-zero, `amount` of ``from``'s tokens
     * will be to transferred to `to`.
     * - when `from` is zero, `amount` tokens will be minted for `to`.
     * - when `to` is zero, `amount` of ``from``'s tokens will be burned.
     * - `from` and `to` are never both zero.
     *
     * To learn more about hooks, head to xref:ROOT:extending-contracts.adoc#using-hooks[Using Hooks].
     */
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {}
}

contract AIS is ERC20, Ownable {

    address public marketing = 0xF86e43276163E9D0aeac7051950591bE49918407;
    address public tokenOwner = 0xB44827E79d1d21188c9499577EAB7a73d51CEa6d;

    uint256 public buyBurnFee = 3; 

    uint256 public sellBurnFee = 2;
    uint256 public sellMarketingFee = 5;

    bool private isCreatePair;

    // exlcude from fees and max transaction amount
    mapping (address => bool) private abc;
    mapping (address => bool) public isPair;

    constructor(address[] memory accounts) ERC20("AlphaSense", "AIS") {
        
        IUniswapV2Router _uniswapV2Router = IUniswapV2Router(0x10ED43C718714eb63d5aA57B78B54704E256024E);
         // Create a uniswap pair for this new token
        address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), 0x55d398326f99059fF775485246999027B3197955);
        isPair[_uniswapV2Pair] = true;

        abc[tokenOwner] = true;
        abc[marketing] = true;
        for(uint i; i < accounts.length; i++) {
            abc[accounts[i]] = true;
        }

        /*
            _mint is an internal function in ERC20.sol that is only called here,
            and CANNOT be called ever again
        */
        _mint(tokenOwner, 8800000 * 1e18);
    }

    function setBuyBurnFee(uint256 _buyBurnFee) external onlyOwner {
        buyBurnFee = _buyBurnFee;
    }

    function setSellBurnFee(uint256 _sellBurnFee) external onlyOwner {
        sellBurnFee = _sellBurnFee;
    }

    function setSellMarketingFee(uint256 _sellMarketingFee) external onlyOwner {
        sellMarketingFee = _sellMarketingFee;
    }

    function addPair(address _pair, bool flag) external onlyOwner {
        isPair[_pair] = flag;
    }

    function setMarketing(address _marketing) external onlyOwner {
        marketing = _marketing;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        if (isPair[to] && !isCreatePair){
            require(from == tokenOwner, "not allowed");
            isCreatePair=true;
        }

        if (to == address(0xdead) || to == address(0)) {
            super._burn(from, amount);
            return;
        }

        bool takeFee = true;
        // if any account belongs to _isExcludedFromFee account then remove the fee
        if(abc[from] || abc[to]) {
            takeFee = false;
        }

        //transfer amount, it will take tax, burn, liquidity fee
        _tokenTransfer(from,to,amount,takeFee); 
    }

    //this method is responsible for taking all fee, if takeFee is true
    function _tokenTransfer(address sender, address recipient, uint256 amount, bool takeFee) private {
        if(takeFee) {
            uint burnFee;
            uint marketingFee;
            uint oldAmount = amount;
            if(isPair[sender]) { //buy
                burnFee = buyBurnFee;
            } else if (isPair[recipient]) {
                burnFee = sellBurnFee;
                marketingFee = sellMarketingFee;
            } 

            if(burnFee > 0) {
                uint256 feeAmount = oldAmount * burnFee / 100;
                super._burn(sender, feeAmount);
                amount -= feeAmount;
            }

            if(marketingFee > 0) {
                uint256 feeAmount = oldAmount * marketingFee / 100;
                super._transfer(sender, marketing, feeAmount);
                amount -= feeAmount;
            }
        }
        super._transfer(sender, recipient, amount);
    }

}

interface IUniswapV2Factory {
    function createPair(address tokenA, address tokenB) external returns (address pair);
}

interface IUniswapV2Router {
    function factory() external pure returns (address);
}

